import React from 'react';

const NavWrapper = styled.div`
  height: 100vh;
  width: 250px;
  background-color: #f5f5f5;
  padding: 15px;
`;

function SideNav() {
  return <NavWrapper>SideNav</NavWrapper>;
}

export default SideNav;
